import * as React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import "./App.css";
import { Table } from "./components/Table";
import { Home } from "./components/Home";

function App() {
  return (
    <>
      <Route path="/" component={Home}>
        <Table />
      </Route>
    </>
  );
}

export default App;
